import React, {useContext, useEffect, useState} from 'react';
import {Badge, ListGroup, Button} from "react-bootstrap";
import {Context} from "../index";

const OrderItem = ({orderCur}) => {


    return (
        <div   className="order" >
            <div className="order-item">{orderCur.client_name.toUpperCase()}</div>
            <div className="order-item">{orderCur.city.toUpperCase()}</div>
            <div className="order-item">ДО: {orderCur.date_to_send.toUpperCase()}</div>
            <div className="order-item">{orderCur.status.toUpperCase()}</div>
            <div className="order-item">{orderCur.payment_status.toUpperCase()}</div>
        </div>
    );
};

export default OrderItem;
